class JSONOutlineSchemaItem{constructor(){this.id="item-"+this.generateUUID(),this.title="New item",this.location="",this.description="",this.parent="",this.metadata={},this.order=0,this.indent=0}readLocation(basePath=""){return FALSE}writeLocation(body,basePath=""){return FALSE}generateUUID(){return"ss-s-s-s-sss".replace(/s/g,this._uuidPart)}_uuidPart(){return Math.floor(65536*(1+Math.random())).toString(16).substring(1)}}export{JSONOutlineSchemaItem};